glL(){return"\u0b0f\u0b15 \u0b1f\u0b47\u0b15\u0b4d\u0b38\u0b1f\u0b4d \u0b2c\u0b1f\u0b28\u0b15\u0b41 \u0b26\u0b2c\u0b3e\u0b07\u0b32\u0b47 \u0b15\u0b3e\u0b33\u0b3f\u0b30 \u0b1b\u0b3f\u0b1f\u0b3f\u0b15\u0b3e \u0b26\u0b47\u0b16\u0b3e\u0b2f\u0b3e\u0b0f \u0b15\u0b3f\u0b28\u0b4d\u0b24\u0b41 \u0b2c\u0b1f\u0b28\u0b4d \u0b09\u0b2a\u0b30\u0b15\u0b41 \u0b09\u0b20\u0b47 \u0b28\u0b3e\u0b39\u0b3f\u0b01\u0964 \u0b1f\u0b41\u0b32\u0b2c\u0b3e\u0b30\u0b30\u0b47, \u0b21\u0b3e\u0b0f\u0b32\u0b17\u0b30\u0b47 \u0b0f\u0b2c\u0b02 \u0b2a\u0b4d\u0b5f\u0b3e\u0b21\u0b3f\u0b02 \u0b38\u0b39 \u0b07\u0b28\u0b32\u0b3e\u0b07\u0b28\u0b30\u0b47 \u0b1f\u0b47\u0b15\u0b4d\u0b38\u0b1f\u0b4d \u0b2c\u0b1f\u0b28\u0b4d \u0b2c\u0b4d\u0b5f\u0b2c\u0b39\u0b3e\u0b30 \u0b15\u0b30\u0b28\u0b4d\u0b24\u0b41"},
