gbp(){return"\u0b2b\u0b4d\u0b32\u0b4b\u0b1f\u0b3f\u0b02 \u0b06\u0b15\u0b4d\u0b38\u0b28\u0b4d \u0b2c\u0b1f\u0b28\u0b4d"},
